import React, { useEffect, useState } from 'react';
import {
  Button,
  Window,
  WindowContent,
  WindowHeader,
  TextInput
} from 'react95';


export default ({setShowNapster}) => {
  return (
    <>
      <Window style={{width: '550px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>America Online - You've got mail!</span>
          <Button style={{marginTop: '2px'}} onClick={()=>{
            setShowNapster(false)}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          <b>Send to: </b>Camille Winters<br />
          <b>Subject: </b>I miss you!
          <TextInput multiline rows={9} fullWidth />
        </WindowContent>
      </Window>

    </>
  );
}
